            #express-loading-icon {
                position: fixed;
                top: 50%;
                left: 50%;
                transform: translate(-50%, -50%);
                width: 100px;
                height: 100px;
                opacity: 1;
                overflow: hidden;
                border-radius: 16px;
            }
            #express-loading-icon svg {
                position: absolute;
                height: 100px;
                width: 100px;
            }
            #express-loading-icon.disappear {
                animation: fadeOut 500ms ease-in forwards;
            }
            #express-loading-icon.disappear img {
                animation-duration: 0s;
            }
